import { useEffect, useState } from "react";
import { motion } from "framer-motion";
import confetti from "canvas-confetti";
import "./App.css";
import bgMusic from "./assets/bg-music.mp3";

const reasons = [
  "Your smile brightens every room 🌟",
  "You care deeply for others 💖",
  "Your creativity is magical 🎨",
  "You always lift people up 🌈",
  "Your laugh is contagious 😄",
  "You're brilliantly smart 🧠",
  "You have a kind heart 💕",
  "You're beautifully unique ✨",
  "You’re strong and courageous 🦸‍♀️",
  "Your energy is inspiring 🔥",
  "You’re an amazing friend 🤗",
  "Your words touch souls 📝",
  "You see beauty in little things 🌸",
  "You bring joy wherever you go 🎉",
  "You dream big 🌌",
  "You always try your best 💪",
  "You make life magical 💫"
];

export default function App() {
  const [showWish, setShowWish] = useState(false);
  const [countdown, setCountdown] = useState("");
  const [showVault, setShowVault] = useState(false);
  const [audio] = useState(new Audio(bgMusic));

  useEffect(() => {
    const birthday = new Date("2025-05-28T00:00:00");
    const interval = setInterval(() => {
      const now = new Date();
      const diff = birthday - now;
      if (diff <= 0) {
        setCountdown("Today is the day!");
        clearInterval(interval);
      } else {
        const days = Math.floor(diff / (1000 * 60 * 60 * 24));
        const hours = Math.floor((diff / (1000 * 60 * 60)) % 24);
        const minutes = Math.floor((diff / 1000 / 60) % 60);
        const seconds = Math.floor((diff / 1000) % 60);
        setCountdown(`${days}d ${hours}h ${minutes}m ${seconds}s`);
      }
    }, 1000);
    return () => clearInterval(interval);
  }, []);

  const handleButtonClick = () => {
    confetti({
      particleCount: 300,
      spread: 180,
      origin: { y: 0.6 },
    });
    setShowWish(true);
    audio.play();
  };

  return (
    <div className="min-h-screen w-full bg-gradient-to-br from-pink-300 via-purple-400 to-indigo-600 text-white overflow-x-hidden">
      <div className="absolute inset-0 bg-[url('/stars-bg.gif')] bg-cover bg-center opacity-20 animate-pulse"></div>
      <div className="relative z-10 flex flex-col items-center justify-center min-h-screen text-center p-4">
        {!showWish ? (
          <motion.div
            className="space-y-8"
            initial={{ opacity: 0 }}
            animate={{ opacity: 1 }}
            transition={{ duration: 1 }}
          >
            <h1 className="text-4xl md:text-5xl font-extrabold drop-shadow-xl">
              Sneha Pradhan turns 17 in…
            </h1>
            <p className="text-2xl animate-pulse drop-shadow-lg">
              {countdown}
            </p>
            <motion.button
              whileHover={{ scale: 1.2 }}
              whileTap={{ scale: 0.9 }}
              onClick={handleButtonClick}
              className="bg-pink-600 hover:bg-pink-500 transition-all duration-300 px-10 py-4 text-lg rounded-full shadow-xl animate-bounce"
            >
              DON’T TOUCH THIS, Sneha 👀
            </motion.button>
          </motion.div>
        ) : (
          <motion.div
            className="space-y-10"
            initial={{ opacity: 0 }}
            animate={{ opacity: 1 }}
            transition={{ duration: 2 }}
          >
            <h2 className="text-4xl md:text-5xl font-bold animate-fade-in">
              Happy 17th Birthday, Sneha Pradhan!
            </h2>
            <p className="text-xl italic animate-fade-in delay-500">
              You’re not just a name, you're a beautiful story unfolding 🌸
            </p>

            <div className="mt-10 grid grid-cols-1 md:grid-cols-3 gap-4 px-4">
              {reasons.map((reason, idx) => (
                <motion.div
                  key={idx}
                  whileHover={{ scale: 1.05 }}
                  className="bg-white/20 backdrop-blur-md p-4 rounded-xl shadow-lg"
                >
                  <p className="text-lg font-medium">{reason}</p>
                </motion.div>
              ))}
            </div>

            <div className="mt-16">
              <motion.button
                whileHover={{ scale: 1.1 }}
                whileTap={{ scale: 0.95 }}
                onClick={() => setShowVault(true)}
                className="bg-yellow-500 text-black px-6 py-3 rounded-xl font-bold shadow-lg hover:shadow-yellow-300"
              >
                🌈 A Gift is Waiting…
              </motion.button>
            </div>

            {showVault && (
              <motion.div
                className="mt-8 text-center max-w-xl mx-auto animate-bounce"
                initial={{ scale: 0 }}
                animate={{ scale: 1 }}
              >
                <p className="text-lg font-semibold mb-4">
                  🎁 You’ve unlocked a heartfelt message 💖
                </p>
                <p className="text-white italic">
                  "Sneha, you are a rare gem. Keep shining, keep dreaming, and never forget how incredibly special you are. The world is better with you in it. 💫"
                </p>
              </motion.div>
            )}

            <div className="mt-16">
              <motion.div
                initial={{ scale: 0 }}
                animate={{ scale: 1 }}
                className="relative bg-pink-300 text-black px-6 py-6 rounded-3xl shadow-2xl"
              >
                <p className="text-xl font-bold mb-2">🎂 Blow the candles!</p>
                <div className="flex justify-center gap-4 mt-4">
                  {[...Array(5)].map((_, i) => (
                    <div
                      key={i}
                      className="w-2 h-16 bg-yellow-400 rounded-full animate-flicker"
                    ></div>
                  ))}
                </div>
                <p className="mt-4 italic text-sm">
                  From someone who believes you're going to light up this world 💖
                </p>
              </motion.div>
            </div>
          </motion.div>
        )}
      </div>
    </div>
  );
}
